description:
Yes, I know this has been upped already, but this is the new scans from Pudgy :)
And if you don't know this, this is NOT for everyone, this is NOT Twilight vampires :)


This is an extremely graphic (Both gory and sexually), series of comic books with art by legendary comic artist Raulo Caceres.  Color covers, B/W interior.


